import http from "../http";
import {useState,useEffect} from 'react';
import {Link} from "react-router-dom";
export default function Home(){

    const [todos,setTodos] = useState([]);
    useEffect(() => {

        fetchallTodos();

    }, []);

    const fetchallTodos = () =>{
        http.get('http://localhost:8000/api/todo').then(res=>{
            console.log(res.data);
            setTodos(res.data);

        })
    }
    return (
        <div>
            <div className="row">
                <div className="col-sm-2">
                </div>
                <div className="col-sm-10">
                    <table className="table">
                        <thead>
                            <tr>
                                <th>S No</th>
                                <th>Todo Name</th>
                                <th>Action</th>
                            </tr>
                        </thead>
                        <tbody>
                           {todos.map((todo,index)=>(
                               <tr key={todo.id}>
                                    <td>{++index}</td>
                                    <td>{todo.name}</td>
                                    <td>
                                        <Link className="btn btn-info" to={{ pathname: "/edit" }}>Edit</Link>&nbsp;
                                    </td>
                                </tr>
                           ))}
                        </tbody>
                    </table>
                </div>
            </div>
        </div>
    )
}
